class Solution:
    def onesMinusZeros(self, grid: list[list[int]]) -> list[list[int]]:
        
        diff = []
        tempList = []
        onesCol = 0
        zerosCol = 0

        #Cases where the grid is a single unit wide
        if len(grid[0]) == 1:

            #get colum number:
            for row in grid:
                if row[0] == 1:
                    onesCol +=1
                else:
                    zerosCol +=1
            
            #Get the row number, and perform the equation
            for z in range(len(grid)):
                diff.append([])
                if grid[z][0] == 1:
                    tempItem = 1+onesCol-0-zerosCol
                else:
                    tempItem = 0+onesCol-1-zerosCol
                
                #Create the diff grid entry
                diff[z].append(tempItem)
            
            return diff


        
        #grid[x] refers to the rows of the grid - each entry in the grid array is a row
        #Ex. would be 3 - there are 3 entries in the grid array, so there are 3 rows
        for x in range(0,len(grid)):
            # print("On row {}".format(x))
            onesRow = grid[x].count(1)
            zerosRow = grid[x].count(0)
            diff.append([])

            
            #This would be the length of the row, allowing us to iterate through each number in the row. grid[x][i] is a specific number in a specific row.
            for i in range(0,len(grid[x])):
                onesCol = 0
                zerosCol = 0
                # print("On entry {}".format(i))
                for row in grid:
                    if row[i] == 1:
                        onesCol+=1
                    else:
                        zerosCol+=1
                
                # print(onesRow,onesCol,zerosRow,zerosCol)
                tempList.append(onesRow+onesCol-zerosRow-zerosCol)

            # print("Appending tempList to diff (tempList = {})".format(tempList))
            diff[x].extend(tempList)
            tempList.clear()
            # print("diff = {}".format(diff))
        return diff




